import React from 'react'

const Sorter = ({issues, onSort}) => {

    const handleSort = (key, order) => {
        onSort(key, order)
    }

  return (
    <div>
         <button type="button" onClick={() => handleSort('name', 'asc')}>
        Sort by Name (Ascending)
      </button>
    </div>
  )
}

export default Sorter
